import React from 'react';
import toons from '../data/toon'
import { Link } from 'react-'

const ToonListPage = () => (
  <React.Fragment>
    <h1>Toons List Page</h1>
    {toons.map(person => (
      <h6>{person.id} {person.firstName} {person.lastName}</h6>
    ))}

  </React.Fragment>
);
export default ToonListPage;
